import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import StartPage from './startPage';
import Step from './step';
import {BrowserRouter, Switch, Route} from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Switch>
        <Route path="/step(.*.{1,})">
          <Step number={window.location.pathname.replace('/step-','')}/>
        </Route>
        <Route>
          <StartPage/>
        </Route>
      </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
